import React from 'react';
import {
  Box,
  Container,
  Typography,
  Grid,
  Card,
  CardContent,
  CardActions,
  Button,
  Chip,
  Stack,
} from '@mui/material';
import ImageWithFallback from '../components/common/ImageWithFallback';
import { imageUrls } from '../data/imageUrls';

const events = [
  {
    title: 'Idea Ignite Hackathon',
    date: 'Dec 9-12, 2024',
    description: 'A national-level hackathon focusing on innovative solutions for real-world problems.',
    image: imageUrls.events.technical,
    category: 'Technical',
  },
  {
    title: 'CAS (AI Fusion 2024)',
    date: 'Dec 11-26, 2024',
    description: 'Conference on Advanced AI Systems featuring leading researchers and industry experts.',
    image: imageUrls.events.technical,
    category: 'Technical',
  },
  {
    title: 'iTech Hackfest 2024',
    date: 'Dec 12-14, 2024',
    description: '48-hour coding marathon with focus on emerging technologies.',
    image: imageUrls.events.technical,
    category: 'Technical',
  },
  {
    title: 'Ninjacart AgriTech Hackathon',
    date: 'Dec 17, 2024',
    description: 'Developing innovative solutions for agriculture using technology.',
    image: imageUrls.events.technical,
    category: 'Technical',
  },
  {
    title: 'Cultural Fest - Ekklesia 2024',
    date: 'Jan 6-11, 2025',
    description: 'Annual cultural festival featuring music, dance, and art performances.',
    image: imageUrls.events.cultural,
    category: 'Cultural',
  },
  {
    title: 'Sports Meet 2024',
    date: 'Dec 23-Jan 1, 2025',
    description: 'Annual sports meet featuring various indoor and outdoor sports competitions.',
    image: imageUrls.events.sports,
    category: 'Sports',
  },
];

const Events = () => {
  return (
    <Box sx={{ py: 8 }}>
      <Container>
        {/* Hero Section */}
        <Box sx={{ textAlign: 'center', mb: 8 }}>
          <Typography variant="h2" gutterBottom sx={{ fontWeight: 700 }}>
            Events @ Sri Eshwar
          </Typography>
          <Typography variant="h5" color="text.secondary">
            Join us for exciting events and activities throughout the year
          </Typography>
        </Box>

        {/* Events Grid */}
        <Grid container spacing={4}>
          {events.map((event, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  transition: 'transform 0.3s',
                  '&:hover': {
                    transform: 'translateY(-8px)',
                  },
                }}
              >
                <ImageWithFallback
                  src={event.image}
                  alt={event.title}
                  fallbackType="event"
                  sx={{ height: 200 }}
                />
                <CardContent sx={{ flexGrow: 1 }}>
                  <Stack
                    direction="row"
                    spacing={1}
                    alignItems="center"
                    sx={{ mb: 2 }}
                  >
                    <Chip
                      label={event.category}
                      color={
                        event.category === 'Technical'
                          ? 'primary'
                          : event.category === 'Cultural'
                          ? 'secondary'
                          : 'success'
                      }
                      size="small"
                    />
                    <Typography variant="body2" color="text.secondary">
                      {event.date}
                    </Typography>
                  </Stack>
                  <Typography variant="h5" gutterBottom component="h2">
                    {event.title}
                  </Typography>
                  <Typography>{event.description}</Typography>
                </CardContent>
                <CardActions>
                  <Button size="small" color="primary">
                    Learn More
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* CTA Section */}
        <Box
          sx={{
            mt: 8,
            p: 4,
            textAlign: 'center',
            bgcolor: 'primary.main',
            color: 'white',
            borderRadius: 2,
          }}
        >
          <Typography variant="h4" gutterBottom>
            Want to Participate?
          </Typography>
          <Typography variant="body1" paragraph>
            Register now to participate in our upcoming events
          </Typography>
          <Button variant="contained" color="secondary" size="large">
            Register Now
          </Button>
        </Box>
      </Container>
    </Box>
  );
};

export default Events;
